export const mainBoxStyles = {
  width: '100%',
  maxWidth: '1920px',
  padding: '10% 0 5% 0',
  alignSelf: 'center',
  outline: '1px solid red',
  color: 'primary.dark',
  overflow: 'visible',
  background: 'url(../images/earth_2.jpg) no-repeat center right fixed',
  margin: '0 auto',
};

export const mainHeaderStyles = {
  maxWidth: '700px',
  textTransform: 'uppercase',
  margin: '0 0 0 22%',
};
